import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Find all <a> elements with exact text "Your Profile"
    // Use XPath to select the first visible one
    const profileLinks = await page.$x("//a[normalize-space(text())='Your Profile']");
    let profileLink = null;
    for (const link of profileLinks) {
      if (await link.isVisible()) {
        profileLink = link;
        break;
      }
    }

    if (!profileLink) {
      throw new Error('Could not find a visible "Your Profile" link');
    }

    // Scroll into view and click the link
    await profileLink.scrollIntoViewIfNeeded();
    await profileLink.click();

    // Wait for Jun's profile content to appear (look for Jun's full name in the DOM)
    // Use text selector for "Jun Kim"
    await page.waitForSelector('text=Jun Kim', { timeout: 5000 });

    // Take screenshot after navigation
    const step2 = path.join(screenshotsDir, 'step_2_jun_profile.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Extract Jun's profile name and bio for verification
    const fullName = await page.textContent('text=Jun Kim');
    const bio = await page.textContent('css=.bio');

    return {
      success: true,
      action: "Navigated to Jun's Profile page and verified profile content.",
      extractedData: {
        fullName: fullName ? fullName.trim() : null,
        bio: bio ? bio.trim() : null
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
